    const {page}=useParams()

    return(
        <>
        <div className="search_bar">
            <div>
                {
                    function(){
                        if(admin_sidebar.indexOf(page)===-1){
                            return(
                            <>
                                <Search_year/>
                                <Search_month/>
                            </>)
                        }
                        else{ 

                        <>
                            <Search_name/>
                            <Search_year/>
                            <Search_month/>
                        </>

                        }
                    }
                }


            </div>
        </div>
        <div className="all_employee">
            {return_component(1)}
        </div>

        </>

    )
}
export default Performance_per_month;
